import React from 'react'


const MovieList = (props) => {

    

    return (
        <li>
            {props.movies.map((movie, index) => (
                <div 
                
                className="grid-container">
                    <div 
                    
                    className="movie-container" 
                    
    >
                        <img className="poster" src={movie.Poster} alt='movie'></img>
                        <li key={index}></li>
                        <h4>{movie.Title}</h4>
                        <p>Year:{movie.Year}</p>
                        <p>Type:{movie.Type}</p> 
                    </div>
                </div>
            ))}
        </li>
    );      
}

export default MovieList;
